import React from "react";
import '../styles/Mens.css';
import cards from '../components/cards';
import Item from '../components/Item';

function Mens() {

  const menCards = cards.filter(card => card.gender === 'men');

  return(
    <div className="mens">
      <div className="mens-image-section"></div>
      <div className="mens-products">
      {menCards.map(card => (
        <a key={card.title} href={`mens/item/${card.title}`} className='card'>
          <Item 
            title={card.title}
            brand={card.brand}
            description={card.description}
            price={card.price}
            image={card.src}
          />
        </a>
      ))}
      </div>
    </div>
  )
}

export default Mens;
